import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./pages/Home";
import SignIn from "./pages/SignIn";

function App() {
  return (
    <Router>
      <Route exact path="/" component={Home} />
      <Route exact path="/" component={SignIn} />
    </Router>
  );
}

export default App;
